@Dan_Simmonite @TheVanaramaNL Fully agree with you and all the others that have commented Dan. 

There is a demand for this sort of content and clubs should be allowed to get it out. 

It's the same with the scorers and attendances or cup results, you can't find them anywhere on the National League website.

Just caught up with @samashton86 ahead of @thesilkmen v Ashton Athletic on Saturday. 

A win for the Silkmen can hand them the @nwcfl title. 

@moorlandssport1 will have a short segment of the interview during Saturday's show and the full interview will be online soon.

@oaphotography1 @bostonutdstats Person who has them in the pub is a friend of mine. Done it every game this season since we've given up selling them at the ground. 

If they do a new edition for the re-arranged game then he will have some.

Also has selection of badges and other programmes from different games.

@onthisdaythefa @ChasetownFC1954 @StourbridgeFC @StaffordTown1st @LudlowTownFC I use the Football League tracker software by Nigel Thomas and found an archive of old league tables. 

This is what it has for that season. 

I don't know how accurate it is but hopefully, it helps in a small way. https://t.co/A83bWeC9hp

